import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
    state = {
        virus: 'corona'
    };
    render() {
        const v = this.state.virus;
        return (
            <>
            <h1 className='title'>React is completely cool</h1>
            <button>Delete{v} from humanity</button>
            </>
        );
    }
}
export default App;
